import React, { Component } from 'react';

class MatchHistory extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <h1>Showing Match History for {this.props.summoner.name}</h1>
      </div>
    )
  }
}

export default MatchHistory;
